import { useState } from "react";
import CustomButton from "../CustomButton"
const options = [
  { value: 'google', label: 'Google' }
]

const NavBar = () => {
  const [menuOpen, setMenuOpen] = useState(false);

  const IconButton = (props: any) => {
    const { path } = props || {}
    return (<CustomButton className="text-[14px] font-medium w-[48px] flex justify-center items-center">
      <img src={`images/${path}`} alt='logo' />
    </CustomButton>
    )
  }
  return (
    <nav className="p-5 bg-white text-black flex items-center justify-between fixed w-full left-0 top-0 z-50 shadow-md">
    {/* Left Section */}
    <div className="flex items-center gap-2">
      <p className="text-gray-700 text-[16px] font-bold">Review</p>
      <select className="border-2 border-[#4D4CAC] text-gray-700 text-[16px] min-w-[184.75px] h-[40px] rounded-[8px]">
        {(options || []).map((option, index) => (
          <option key={index} value={option.value}>
            {option.label}
          </option>
        ))}
      </select>
      <CustomButton className="bg-[#40E1FA1A] text-[#2CA01D] text-[12px] font-bold w-[140px] hidden md:block">
        Quickbook’s Data
      </CustomButton>
    </div>

    {/* Hamburger Menu for Mobile */}
    <button
      className="text-black md:hidden"
      onClick={() => setMenuOpen(!menuOpen)}
    >
      ☰
    </button>

    {/* Right Section (Hidden on Mobile) */}
    <div
      className={`flex items-center gap-1 ${
        menuOpen ? "block absolute top-16 left-0 w-full bg-white shadow-md p-4" : "hidden"
      } md:flex md:static md:bg-transparent md:shadow-none md:p-0`}
    >
      <IconButton path="search.svg" />
      <CustomButton className="text-[14px] font-medium w-[120px]">
        Export to Excel
      </CustomButton>
      <CustomButton className="text-[14px] font-medium w-[120px]">
        Add Document
      </CustomButton>
      <CustomButton className="text-[14px] font-medium w-[120px]">
        Connect
      </CustomButton>
      <IconButton path="bell.svg" />
      <IconButton path="settings.svg" />
      <IconButton path="person.svg" />
    </div>
  </nav>
  )
}

export default NavBar
